import React from 'react';
import styled from 'styled-components';

const Element = styled.div`
    position: absolute;
    top: 0;
    left: 0;
    bottom: 0;
    right: 0;
    background-color: coral;
`;

const SearchResultsLoading = () => {
    return (
        <Element/>
    );
}

export default SearchResultsLoading;
